import React from "react";
import DisplayPicture from "../component/DisplayPicture";
import Introduction from "../component/Introduction";

function BioDiv() {
  return (
    <div className="bio-div">
      <div
        className="image-div"
        style={{ display: "block", border: "1px solid black", padding: "10px" }}
      >
        <DisplayPicture />{" "}
      </div>

      <div>
        <Introduction />{" "}
      </div>
    </div>
  );
}

export default BioDiv;
